import React from 'react';
import { Grid, Paper, Typography, Box } from '@mui/material';
import {
  Flight as FlightIcon,
  People as PeopleIcon,
  AttachMoney as MoneyIcon,
  Assessment as ChartIcon,
} from '@mui/icons-material';

const StatCard = ({ title, value, icon: Icon, color }) => (
  <Paper
    sx={{
      p: 3,
      display: 'flex',
      flexDirection: 'column',
      height: '100%',
      backgroundColor: (theme) =>
        theme.palette.mode === 'dark' ? theme.palette.grey[800] : theme.palette.grey[100],
      '&:hover': {
        boxShadow: 3,
        transform: 'translateY(-4px)',
        transition: 'all 0.3s ease-in-out',
      },
    }}
    elevation={2}
  >
    <Box display="flex" justifyContent="space-between" alignItems="center">
      <Box>
        <Typography variant="h6" color="textSecondary" gutterBottom>
          {title}
        </Typography>
        <Typography variant="h4" component="div">
          {value}
        </Typography>
      </Box>
      <Icon
        sx={{
          fontSize: 48,
          color: color || 'primary.main',
          opacity: 0.8,
        }}
      />
    </Box>
  </Paper>
);

const Dashboard = () => {
  const stats = [
    { title: 'Tổng chuyến bay', value: '1,234', icon: FlightIcon, color: 'primary.main' },
    { title: 'Người dùng', value: '5,678', icon: PeopleIcon, color: 'success.main' },
    { title: 'Doanh thu tháng', value: '1.2B VNĐ', icon: MoneyIcon, color: 'warning.main' },
    { title: 'Tỷ lệ đặt vé', value: '78%', icon: ChartIcon, color: 'error.main' },
  ];

  return (
    <Box sx={{ flexGrow: 1 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Tổng quan
      </Typography>

      <Grid container spacing={3} sx={{ mb: 4 }}>
        {stats.map((stat, index) => (
          <Grid item xs={12} sm={6} md={3} key={index}>
            <StatCard
              title={stat.title}
              value={stat.value}
              icon={stat.icon}
              color={stat.color}
            />
          </Grid>
        ))}
      </Grid>

      <Grid container spacing={3}>
        <Grid item xs={12} md={8}>
          <Paper sx={{ p: 3, height: '100%' }}>
            <Typography variant="h6" gutterBottom>
              Thống kê đặt vé
            </Typography>
            <Box sx={{ height: 300, backgroundColor: 'grey.100', borderRadius: 1 }}>
              {/* Placeholder for chart */}
              <Box
                display="flex"
                justifyContent="center"
                alignItems="center"
                height="100%"
                color="text.secondary"
              >
                Biểu đồ thống kê sẽ hiển thị ở đây
              </Box>
            </Box>
          </Paper>
        </Grid>
        <Grid item xs={12} md={4}>
          <Paper sx={{ p: 3, height: '100%' }}>
            <Typography variant="h6" gutterBottom>
              Hoạt động gần đây
            </Typography>
            <Box>
              {[1, 2, 3, 4, 5].map((item) => (
                <Box
                  key={item}
                  sx={{
                    p: 2,
                    mb: 1,
                    backgroundColor: 'grey.50',
                    borderRadius: 1,
                    borderLeft: '4px solid',
                    borderColor: 'primary.main',
                  }}
                >
                  <Typography variant="subtitle2">Người dùng mới đăng ký</Typography>
                  <Typography variant="body2" color="textSecondary">
                    10 phút trước
                  </Typography>
                </Box>
              ))}
            </Box>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Dashboard;
